import { Link } from "react-router-dom";
import React, { useContext } from "react";
import { UserContext } from "../utils/UserContext";

export const Home = () => {
  const { user, setUser } = useContext(UserContext);

  return (
    <div>
      <h2>Home</h2>
      <pre> {JSON.stringify(user, null, 2)} </pre>
      <br />
      <button
        onClick={() => {
          // call logout
          setUser("Eythor");
        }}
      >
        logout
      </button>
    </div>
  );
};
